import { CLICKED_PREVENT_SPAM, ENDED_PREVENT_SPAM } from "./preventTypes";

export const clickPreventSpam = () => {
  return {
    type: CLICKED_PREVENT_SPAM,
  };
};

export const endedPreventSpam = () => {
  return {
    type: ENDED_PREVENT_SPAM,
  };
};
